    <p>{`InfluxDB uses `}<a parentName="p" {...{
        "href": "https://v2.docs.influxdata.com/v2.0/reference/syntax/line-protocol/"
      }}>{`line protocol`}</a>{` to write data points. It is a text-based format that provides the measurement, tag set, field set, and timestamp of a data point.`}</p>
    <p>{`A `}<inlineCode parentName="p">{`Log Event`}</inlineCode>{` event contains an arbitrary set of fields (key/value pairs) that describe the event.`}</p>
